import 'react-native-gesture-handler';
import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import Profile from './components/Profile/Profile';
import Deck from './components/CardDeck/Deck';
import AddDeckCard from './components/Profile/AddDeckCard';

const Stack = createStackNavigator();

const user = {
  username: 'Hally255'
}

export default function App(){
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name='Deck List' component={Deck} initialParams={user} />
        <Stack.Screen name='Add to Deck List' component={Deck} initialParams={user} />
        <Stack.Screen name='Profile' component={Profile} />
      </Stack.Navigator>
    </NavigationContainer>
  )
}
